    def parse(self, response):
        f = open("product.html", "w")
        f.write(response.body.decode("utf-8"))
        f.close()
        page = response.xpath("//div[contains(@class,'content-area')]")
        details = page.xpath("//div[contains(@class,'entry-summary')]")
        # image = page.xpath("//div[contains(@class,'summary-before')]/div[contains(@class,'product-images')]/div[contains(@class,'product-image-slider')]/div[contains(@class,'owl-stage-outer')]/div[contains(@class,'owl-stage')]/div[contains(@class,'owl-item')]/div/div")
        image = page.xpath("//div[contains(@class,'summary-before')]/div[contains(@class,'product-images')]//div/div/div")
        yield {
            'product-url': response.url,
            'title': details.xpath("./h1/text()").get(),
            'price': details.xpath("//p[contains(@class,'price')]/span/text()").get(),
            'description': page.xpath("//div[contains(@class,'product-summary-wrap')]/div/div[contains(@class,'entry-summary')]//div[contains(@class,'description')]/p/text()").getall(),
            'categories': details.xpath("./div[contains(@class,'product_meta')]/span[contains(@class,'posted_in')]/a/text()").getall(),
            'image': image.xpath("./img/@src").getall(),
        }
